	@Test
    public void testStandard() {
    	String html = "<p>\n" + 
    			"In <a href=\"/wiki/Topology\">topology</a>, the <b>long line</b> (or\n" + 
    			"<b>Alexandroff line</b>) is a\n" + 
    			"<a href=\"/wiki/Topological_space\">topological space</a> somewhat similar to\n" + 
    			"the <a href=\"/wiki/Real_line\">real line</a>, but in a certain way \"longer\". It\n" + 
    			"behaves locally just like the real line, but has different large-scale\n" + 
    			"properties (e.g., it is neither\n" + 
    			"<a href=\"/wiki/Lindel%C3%B6f_space\">LindelÃ¶f</a> nor\n" + 
    			"<a href=\"/wiki/Separable_space\">separable</a>). Therefore, it serves as one of\n" + 
    			"the basic counterexamples of topology\n" + 
    			"<a href=\"http://www.ams.org/mathscinet-getitem?mr=507446\">[1]</a>.\n" + 
    			"Intuitively, the usual real-number line consists of a countable number of line\n" + 
    			"segments [0,1) laid end-to-end, whereas the long line is constructed from an\n" + 
    			"uncountable number of such segments. You can consult\n" + 
    			"<a href=\"/wiki/Special:BookSources/978-1-55608-010-4\">this</a> book for more\n" + 
    			"information.\n" + 
    			"</p>";
        Set<String> value = Drill07.findWikiLinks(html);
        Set<String> expected = new HashSet<String>();
        expected.add("Topology");
        expected.add("Topological_space");
        expected.add("Real_line");
        expected.add("Lindel%C3%B6f_space");
        expected.add("Separable_space");

        assertEquals(expected, value);
    }
    
